import React from 'react'
import { useEffect,  useState } from 'react';

function App() {
  const [data, setData] = useState(null);
  useEffect(() => {
    fetch('/api')
      .then(res => res.json())
      .then(data => setData(this.data.message))
  }, []);

  return (
    <div className="App">
      <h1>{data}</h1>
    </div>
  );
}

export default App;
